function slide_r() {
	$('.aos-init').each(function (i) {
		if ($(this).is(":visible")) {
			if (i == $('.aos-init').length - 1) {
				var toind = 0;
			} else {
				var toind = i + 1;
			}


			var pos = $('.aos-init')[toind];

			$(this).fadeOut("fast", function () {
				$(pos).fadeIn("fast");
			});
			return false;
		}
	})

}

function slide_l() {
	$('.aos-init').each(function (i) {
		if ($(this).is(":visible")) {
			if (i == 0) {
				var toind = $('.aos-init').length - 1;
			} else {
				var toind = i - 1;
			}

			var pos = $('.aos-init')[toind];

			$(this).fadeOut("fast", function () {
				$(pos).fadeIn("fast");
			});
			return false;
		}
	})

}

$('.slide_right').click(function () {
	slide_r();
})
$('.slide_left').click(function () {
	slide_l();
})
